import './App.css';
import Navbar from './Navbar';

function App() {

  const person = {name: "Smriti" , age: 21};
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <h2> Hi I am { person.name}, and my age is { person.age} </h2>
        <p></p>
      </div>
    </div>
  );
}

export default App;
